import React from "react";

import "./Project.css";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

const project = props => (
  <ul className="project">
    <li className="project__image">
      <img src={props.image} alt={props.title} />
    </li>
    <li className="project__info">
      <ul className="project__content">
        <li className="project__title">{props.title}</li>
        <li className="project__explanation">{props.explanation}</li>
        <li className="project__paper">
          <a href={props.paper}>[Paper]</a>
        </li>
        <li className="project__github">
          <a href={props.github}>[Github]</a>
        </li>
      </ul>
    </li>
  </ul>
);

export default project;
